import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import Calendar from './components/Calendar';
import AppointmentForm from './components/AppointmentForm';

const App = () => {
  return (
    <div>
      <Header />
      <main>
        <Calendar />
        <AppointmentForm />
      </main>
      <Footer />
    </div>
  );
};

export default App;
